import React, {Component} from 'react';
import { Timeline } from 'antd';
import axios from 'axios';
import Header from './Components/Header';
import TimelineCard from "./Components/TimelineCard";


class App extends Component {
  state = {
    purchase: []
  }
  componentWillMount() {
    axios.get('https://storage.googleapis.com/dito-questions/events.json')
        .then(res => {
            let event = res.data.events;

            event.forEach(event => {
              if (event.event === 'comprou') this.state.purchase.push(event)
              console.log(event.event)
            })
          }
        )
        .catch(error => console.log(error))
  }
  render(){
    return (
        <div>
          <Header />
          <Timeline style={{margin: '15px', marginRight: '8px'}}>
            {
              (this.state.events) &&
                  this.state.events.map((event,i) => {
                    return <TimelineCard key={i} />
                  })
            }
          </Timeline>
        </div>
    );
  }
}


export default App;
